                    <li>
                        <div classname="uk-card uk-card-default uk-card-body">
                            <h3 classname="uk-card-title">Default</h3>
                            <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit.</p>
                        </div>
                    </li>
                </ul>
            </div>

        </section>

    );

}


export default Works
